import React from 'react';
import classes from './Posts.css';
import PropTypes from 'prop-types';

export default function Posts(props) {
  return (
    <div className={classes.posts}>
        <img className={classes.image} src={props.image} alt="" />
        <p className={classes.price}>{props.price}</p>
        <p className={classes.Date_Bought}>{props.Date_Bought}</p>
        <p className={classes.Product}>{props.Product}</p>
        <p className={classes.Post_date}>{props.Post_date}</p>
        <p className={classes.Hostel}>{props.Hostel}</p>
    </div>
  )
};


posts.defaultProps ={
    image: "https://cdn.dribbble.com/users/1787778/screenshots/3713333/media/a684905500dc9268e81c03a8a7ad6e09.png?compress=1&resize=800x600&vertical=top",
    price:'₹5,00,000',
    Date_Bought:'March, 2021',
    Product:'Holy-Shit',
    Post_date:'Today',
    Hostel:'Brahmaputra'
};
